let _markdown = "\n\nInstallation [#installation]\n\nThis guide walks you through setting up LinkDen on your local machine for development or preview before deploying to Cloudflare.\n\nPrerequisites [#prerequisites]\n\nBefore you begin, make sure you have the following installed:\n\n* **Node.js 22+** -- Download from [nodejs.org](https://nodejs.org) or use a version manager like `nvm` or `fnm`.\n* **pnpm 10+** -- LinkDen uses pnpm workspaces. Enable it via Corepack:\n\n```bash\ncorepack enable && corepack prepare pnpm@latest --activate\n```\n\n* **Cloudflare account** -- A free account at [cloudflare.com](https://cloudflare.com) is sufficient for development.\n\nClone the Repository [#clone-the-repository]\n\n```bash\ngit clone https://github.com/mrdemonwolf/linkden.git\ncd linkden\n```\n\nInstall Dependencies [#install-dependencies]\n\nRun pnpm install from the root of the monorepo. Turborepo and pnpm workspaces will handle installing dependencies for all apps and packages:\n\n```bash\npnpm install\n```\n\nThis installs dependencies for:\n\n* `apps/web` -- the Next.js frontend\n* `apps/server` -- the Hono API server\n* `apps/docs` -- this documentation site\n* `packages/api` -- tRPC router definitions\n* `packages/auth` -- Better Auth configuration\n* `packages/db` -- Drizzle ORM schema and migrations\n* `packages/env` -- shared environment variable validation\n* `packages/ui` -- shared UI components (Radix + Tailwind)\n* `packages/validators` -- shared Zod schemas\n* `packages/infra` -- Alchemy deployment configuration\n\nSet Up Environment Variables [#set-up-environment-variables]\n\nCopy the example environment file:\n\n```bash\ncp .env.example .env\n```\n\nEdit `.env` and set the following variables:\n\n| Variable                 | Description                        | Example                                 |\n| ------------------------ | ---------------------------------- | --------------------------------------- |\n| `BETTER_AUTH_SECRET`     | Secret key for session signing     | Generate with `openssl rand -base64 32` |\n| `BETTER_AUTH_URL`        | Base URL for the auth server       | `http://localhost:3000`                 |\n| `CORS_ORIGIN`            | Allowed CORS origin (frontend URL) | `http://localhost:3001`                 |\n| `NEXT_PUBLIC_SERVER_URL` | Public URL of the API server       | `http://localhost:3000`                 |\n\nSee the [Configuration](/docs/getting-started/configuration) guide for details.\n\nPush Database Schema [#push-database-schema]\n\nLinkDen uses Cloudflare D1 (SQLite) with Drizzle ORM. Push the schema to your database:\n\n```bash\npnpm db:push\n```\n\nStart the Development Servers [#start-the-development-servers]\n\n```bash\npnpm dev\n```\n\nThis starts all apps in development mode via Turborepo:\n\n* **Web app** -- `http://localhost:3001`\n* **API server** -- `http://localhost:3000`\n* **Docs** -- `http://localhost:3002`\n\nOpen `http://localhost:3001` in your browser.\n\nVerify the Installation [#verify-the-installation]\n\n1. Navigate to `http://localhost:3001` -- you should see the public link page (empty by default).\n2. Navigate to `http://localhost:3001/admin/setup` -- you should see the setup wizard.\n3. Complete the 4-step setup wizard (Account, Profile, Theme, Done).\n4. You should land on the block builder at `/admin/builder`.\n\nNext Steps [#next-steps]\n\n* [Quick Start](/docs/getting-started/quick-start) -- Walk through the setup wizard and first-time configuration.\n* [Configuration](/docs/getting-started/configuration) -- Configure environment variables.\n* [Deployment](/docs/getting-started/deployment) -- Deploy your instance to Cloudflare.\n";
